import React from "react";
import './css/Footer.css';

function Footer() {
    return (
        <>
            <div className="line"></div>
            <div className="footer">
                
                <div className="contents">
                    <p>HTML</p>
                    <p>CSS</p>
                    <p>Js</p>
                    <p>Python</p>
                    <p>Java</p>
                    <p>Solidity</p>
                    <p>React</p>
                    <p>Django</p>
                    <p>react</p>
                    <p>react</p>
                </div>
            </div>
        </>
    );
}
export default Footer;
